import React from "react";

function SummerRefresh() {
  return (
    <iframe
      src={`${process.env.PUBLIC_URL}/projects/build/index.html`}
      style={{ width: "100%", height: "100vh", border: "none" }}
      title="My React App"
    ></iframe>
  );
}

export default SummerRefresh;
